  false,\n\t\"url\": null,\n\t\"notes\": \" n        This performance evaluation will
  employ a combination of quantitative and qualitative approaches to answer questions
  related to the relevance, effectiveness, and sustainability of MCC's Regional Study
  and Resource Center (RSRC) Activity in Namibia. The results of this evaluation are
  expected to inform ongoing operations at the RSRCs and influence the design and
  implementation of RSRCs planned for other regions of Namibia. Evaluation questions
  include the following:n- Was the MCC investment implemented according to plan?n-
  What types of resources and programming are RSRCs providing?n- Who uses the RSRCs
  and what do they do? n- Do students, job seekers and business people report outcomes
  such as improved test scores, job seeking and acquisition, and business creation
  and enhancement as a result of using the resources provided by RSRCs? n- How sustainable
  are the RSRCs? n- How active is leadership in promoting and achieving the vision
  of the RSRCs? n- What is the influence of the RSRCs beyond their walls?n      \",\n\t\"license_title\":
